package main

import "fmt"

func main() {
	//fmt.Println(minWindow("", ""))
	fmt.Println(minWindow("bBbaBAbaAB", "bbB"))
}

/**
 * ========== 最小覆盖子串问题 ==========
 * 给你一个字符串 S、一个字符串 T，在字符串 S 里面找出：包含 T 所有字母的最小子串。
 * ========== 解题思路 ==========
 * 1. 滑块算法解题，动态伸缩滑块的长度
 * 2. 找出一个最开始的字符串滑块 L，包含 T 里面的所有字母。
 * 3. L 从左侧开始收缩，如果收缩后任然包含 T 的字符，更新最小窗口大小，继续收缩。
 * 4. 如果收缩后不包含所有 T 字符，从右侧向外扩张到包含所有 T 字符。如果扩张后窗口变小，更新窗口，继续第 2 步。
 */
func minWindow(s string, t string) string {
	sLen := len(s)

	if sLen == 0 {
		return ""
	}

	tLen := len(t)

	if tLen == 0 || tLen > sLen {
		return ""
	}

	maps := make(map[byte]int)

	for i := 0; i < len(t); i ++ {
		maps[t[i]]++
	}

	minLeft, minRight, left, right := 0, 0, 0, 1
	for left <= sLen - tLen && right <= sLen {

		nm := make(map[byte]int)

		for k, v := range maps {
			nm[k] = v
		}

		if contains(s, left , right , nm) {
			if  right - left < minRight - minLeft || minRight == 0 {
				minLeft = left
				minRight = right
			}

			left ++
		} else {
			right ++
		}
	}

	return s[minLeft:minRight]
}

func contains(s string, left int, right int, t map[byte]int) bool {
	for i := left; i < right; i ++ {
		if t[s[i]] > 0 {
			t[s[i]] --
		}
	}

	for _, v := range t {
		if v > 0 {
			return false
		}
	}

	return true
}